import React from "react";
import { useParams } from "react-router-dom";

export default function Order({ orders }) {
  const { id } = useParams();
  console.log(id);
  const order = orders.find((order) => {
    return orders.id === Number(id);
  });
  console.log(orders);
  return (
    <>
      <title>Order {id}</title>
      {/* <h3>{order.title}</h3> */}
    </>
  );
}
